.examination {
  width: 100%;
  height: 800px;
  background: #eee;
}

.head {
  height: 80px;
  padding: 30px;
  box-sizing: border-box;
  font-size: 30px;
}

.Allbox {
  width: 96%;
  height: 700px;
  background: #fff;
  margin: 0 auto;
  border-radius: 15px;
  display: flex;
  flex-direction: column;
  .NameExamination {
    height: 120px;
    margin-top: 12px;
    p {
      margin-left: 40px;
    }
    .name {
      width: 450px;
      height: 40px;
      margin-left: 40px;
      border-radius: 10px;
      border: solid 1px #ccc;
      padding: 0 15px;
      outline: none;
    }
    .explain {
      margin-left: 40px;
      color: red;
      transition: color 0.3s cubic-bezier(0.215, 0.61, 0.355, 1);
      margin-top: 2px;
    }
  }
  .examType {
    height: 120px;
    margin-top: 2px;
    p {
      margin-left: 40px;
    }
    .name {
      width: 150px;
      height: 50px;
      margin-left: 40px;
    }
    .explain {
      margin-left: 40px;
      color: red;
      transition: color 0.3s cubic-bezier(0.215, 0.61, 0.355, 1);
      margin-top: -8px;
    }
  }

  .classType {
    height: 120px;
    margin-top: 2px;
    p {
      margin-left: 40px;
    }
    .name {
      width: 150px;
      height: 50px;
      margin-left: 40px;
    }
    .explain {
      margin-left: 40px;
      color: red;
      transition: color 0.3s cubic-bezier(0.215, 0.61, 0.355, 1);
      margin-top: -8px;
    }
  }

  .Number {
    height: 120px;
    margin-top: 2px;
    p {
      margin-left: 40px;
    }
    .name {
      width: 150px;
      height: 36px;
      margin-left: 40px;
    }
    .explain {
      margin-left: 40px;
      color: red;
      transition: color 0.3s cubic-bezier(0.215, 0.61, 0.355, 1);
    }
  }

  .block {
    height: 80px;
    margin-top: 12px;
    div {
      margin-left: 40px;
      margin-bottom: 15px;
    }
    span {
      margin-top: 8px;
      margin-left: 10px;
    }
    .els {
      margin: 0;
      padding: 0;
      margin-left: -30px;
    }

    .time {
      display: flex;
      margin: 0;
      margin-left: -38px;
      div:first-child {
        .explain {
          margin-left: 40px;
          color: red;
          transition: color 0.3s cubic-bezier(0.215, 0.61, 0.355, 1);
          margin-top: -8px;
        }
      }
      div:last-child {
        .explain {
          margin-left: -30px;
          margin-top: 7px;
          color: red;
          transition: color 0.3s cubic-bezier(0.215, 0.61, 0.355, 1);
        }
      }
    }
  }

  .btn {
    margin-top: 22px;
    margin-left: 40px;
  }
}
